import React from "react"
import Layout from "../components/layout/Layout"

const PageNotFound = () => {
    return(
        <Layout title={"go back- page not found"}>
                <h1>404</h1>
                <h2>Oops ! Page Not Found</h2>
                <button style={{padding: "10px"}}> Go Back </button>  

        </Layout>
    )
}

export default PageNotFound
